    ComparePriceComponent.prototype.loadLocations = function () {
        var _this = this;
        this.waitLayer = true;
        this.getCities().subscribe((function (data) {
            _this.locations = data['data'];
            //console.log(this.locations);
            var myLoc = { 'id': _this.locationSes["id"], 'name': _this.locationSes["name"] };
            var myLoc1 = { 'id': _this.locationSes["id"], 'name': _this.locationSes["state"] };
            _this.locations["user_location"] = [myLoc];
            _this.locations["user_state"] = [myLoc1];
            //         console.log(this.locations)
            if (_this.locations["near_cities"].length == 0) {
                _this.nearByCities = false;
            }
            if (_this.locations["near_other_cities"].length == 0) {
                _this.nearByOtherCities = false;
            }
            if (_this.cookieService.get('selcted_city_id') != "") {
                _this.selectedLocation = _this.cookieService.get('selcted_city_id');
            }
            else {
                _this.selectedLocation = 0;
            }
            //  console.log(this.selectedLocation);
            /*if(this.locationSes["city_level"]){
              this.selectedLocName = this.locationSes["name"];
            }else{
              this.selectedLocName = this.locationSes["state"]+", "+this.locationSes["country"];
            }*/
            _this.route.params.subscribe(function (params) {
                _this.globals.location_global_url = params['country'];
                if (typeof params['cityName'] !== "undefined") {
                    _this.route_cityname = params['cityName'];
                    //console.log(this.locations)
                    var selectedCity = [];
                    selectedCity = _this.locations["rest_cities"].filter(function (loc) { return loc.city.replace(/\s+/g, '-').toLowerCase() === params['cityName']; });
                    if (selectedCity.length == 0) {
                        selectedCity = _this.locations["near_cities"].filter(function (loc) { return loc.city.replace(/\s+/g, '-').toLowerCase() === params['cityName']; });
                    }
                    if (selectedCity.length == 0) {
                        selectedCity = _this.locations["near_other_cities"].filter(function (loc) { return loc.city.replace(/\s+/g, '-').toLowerCase() === params['cityName']; });
                    }
                    if (_this.cookieService.get('selcted_city_id') != "") {
                        //console.log(selectedCity)
                        _this.selectedLocation = _this.cookieService.get('selcted_city_id');
                    }
                    else if (selectedCity.length == 0) {
                        //console.log('default')
                        _this.selectedLocation = _this.locationSes["id"];
                    }
                    else {
                        // console.log('selected')
                        _this.selectedLocation = selectedCity[0].id;
                    }
                }
                else if (typeof params['stateName'] !== "undefined") {
                    var selectedState = [];
                    selectedState = _this.locations["state"].filter(function (loc) { return loc.state.replace(/\s+/g, '-').toLowerCase() === params['stateName']; });
                    if (selectedState.length != 0) {
                        _this.selectedLocation = selectedState[0].state_id;
                    }
                }
                else {
                    _this.selectedStateName = _this.locationSes["state"];
                    _this.selectedstateid = _this.locationSes["state_id"];
                }
                if (typeof params['strainName'] !== "undefined") {
                    _this.route_strain = params['strainName'];
                    //this.getStrainid(this.route_strain)
                }
                else {
                    _this.selectedStrName = "Marijuana";
                    _this.selectedStrain = 0;
                }
                if (typeof params['stateName'] !== "undefined") {
                    _this.route_statename = params['stateName'];
                }
            });
            setTimeout(function () {
                jQuery('#converter-location').select2();
            }, 100);
        }), function (err) { return console.log(err); }, function () {
            _this.loadStrains();
            _this.waitLayer = false;
        });
    };
