        var title = "";
        var subText = "";
        if (this.selectedMedical.length > 0) {
            this.selectedMedical.forEach(function (item, index) {
                item = item.split(":");
                if (item[0] && !item[1]) {
                    item = item[0];
                }
                else {
                    item = item[1];
                    item = item.replace(/['"]+/g, '');
                }
                // console.log(item);     
                item = $.trim(item);
                if (index == 0) {
                    fu = "/medical-" + item;
                    title = "that helps with " + item.charAt(0).toUpperCase() + item.slice(1).toLowerCase();
                    subText = item.charAt(0).toUpperCase() + item.slice(1).toLowerCase();
                }
                else {
                    fu = fu + "," + item;
                    title = title + ", " + item.charAt(0).toUpperCase() + item.slice(1).toLowerCase();
                    subText = subText + ", " + item.charAt(0).toUpperCase() + item.slice(1).toLowerCase();
                }
            });
        }
        if (this.selectedFlavour.length > 0) {
            this.selectedFlavour.forEach(function (item, index) {
                item = item.split(":");
                if (item[0] && !item[1]) {
                    item = item[0];
                }
                else {
                    item = item[1];
                    item = item.replace(/['"]+/g, '');
                }
                //console.log(item);     
                item = $.trim(item);
                if (index == 0) {
                    fu = fu + "/flavour-" + item;
                    title = title + " and smells like " + item;
                }
                else {
                    fu = fu + "," + item;
                    title = title + ", " + item;
                }
            });
        }
        fu = fu.replace(/\s+/g, '-').toLowerCase();
        fu = fu.replace(/^\/|\/$/g, '');
        this.feel_like_title = title;
        if (subText == "") {
            subText = "any medical purpose";
        }
        this.sub_text = subText;
        return fu;
